import React from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import './Restaurant.css';

import RestaurantLogin from "./components.r/loginpage.restaurant"
import RestaurantProfile from "./components.r/res_system.restaurant"
import CreateRestaurant from "./components.r/createRestaurant.restaurant"
import RestaurantEvent from "./components.r/eventspage.restaurant"
import RestaurantBalance from "./components.r/accountbalance.restaurant"
import RestaurantPage from "./components.r/yourpage.restaurant"

function Restaurant() {
    return (

     <Router>


        <Route path = "/restaurant/login" exact component = {RestaurantLogin}/>
        <Route path = "/restaurant/profile" exact component = {RestaurantProfile}/> 
        <Route path = "/restaurant/register" exact component = {CreateRestaurant}/> 
        <Route path = "/restaurant/event" exact component = {RestaurantEvent}/>
        <Route path = "/restaurant/payment" exact component = {RestaurantBalance}/>
        <Route path = "/restaurant/yourpage" exact component = {RestaurantPage}/>


      </Router>


    );
  }

  export default Restaurant;
